Idea: Make a type threadsafe by protecting the internal state with a Mutex . This type implements Clone , so it can be easily shared between threads. use std::sync::{Arc, Mutex}; #[derive(Clone)]
struct Counter(Arc<Mutex<u64>>); impl Counter { fn new() -> Self { // Internal state is protected by a Mutex Counter(Arc::new(Mutex::new(0))) } fn value(&self) -> u64 { *self.0.lock().unwrap() } fn increment(&self) { *self.0.lock().unwrap() += 1; }
}

