Idea: Split a class into an exclusive owned type and a thread-safe handle. use std::io;
use std::sync::mpsc; /// Worker with exclusive access to a resource.
struct Worker { channel: mpsc::Receiver<Message>
} impl Worker { /// Returns ([`Worker`], [`Handle`]) pair. fn new() -> (Self, Handle) { // Channel for sending messages to the worker. let (tx, rx) = mpsc::channel(); (Worker { channel: rx }, Handle { channel: tx }) } /// Function which takes exclusive access of [`Worker`]. fn run(&mut self) { loop { while let Ok(message) = self.channel.recv() { match message { Message::Foo(value) => println!("Foo: {}", value), } } } }
} /// Handle for interfacing with the worker.
#[derive(Clone)]
struct Handle { channel: mpsc::Sender<Message>
} impl Handle { fn foo(&self, value: i32) { self.channel.send(Message::Foo(value)).unwrap() }
} /// Messages that can be sent to [`Worker`].
enum Message { Foo(i32)
}

